tables.table_schema:
CREATE TABLE materials (
    material_id INT PRIMARY KEY,
    material_name STRING,
    material_properties STRING,
    cost_per_unit DECIMAL
);

CREATE TABLE manufacturers (
    manufacturer_id INT PRIMARY KEY,
    manufacturer_name STRING,
    material_id INT,
    FOREIGN KEY (material_id) REFERENCES materials(material_id)
);

CREATE TABLE materials (
    material_id INT PRIMARY KEY,
    material_name VARCHAR(255),
    material_properties TEXT,
    cost_per_unit DECIMAL
);

CREATE TABLE material_properties (
    property_id INT PRIMARY KEY,
    property_name VARCHAR(255),
    property_description TEXT
);

CREATE TABLE material_cost (
    cost_id INT PRIMARY KEY,
    material_id INT,
    cost DECIMAL
);

CREATE TABLE material_properties (
  material_id INT PRIMARY KEY,
  material_name VARCHAR(255) NOT NULL,
  density FLOAT NOT NULL,
  tensile_strength FLOAT NOT NULL
);

CREATE TABLE cost_per_unit (
  material_id INT PRIMARY KEY,
  material_name VARCHAR(255) NOT NULL,
  cost_per_unit DECIMAL(10, 2) NOT NULL
);

CREATE TABLE material_characteristics (
  material_id INT PRIMARY KEY,
  melting_point INT NOT NULL,
  heat_resistance BOOLEAN NOT NULL
);

CREATE TABLE material_usage (
  material_id INT PRIMARY KEY,
  application VARCHAR(255) NOT NULL,
  durability BOOLEAN NOT NULL
);

CREATE TABLE material_inventory (
  material_id INT PRIMARY KEY,
  quantity INT NOT NULL,
  supplier VARCHAR(255) NOT NULL
);
